import React from "react";
import Camisetas from "./Camisetas";
import imagem1 from "../imagens/imagem1.jpeg"
import imagem2 from "../imagens/imagem2.jpeg"
import imagem3 from "../imagens/imagem3.jpeg"
import {imagem4, imagem5, imagem6} from "../imagens/"



function HomePage (){
    return(
        <div>
            HomePage
            <Camisetas foto={ <img  src={imagem1} alt="CAMISETA 1"/>} valor={"45,00"} comprar={<button>comprar</button>}/>
            <Camisetas foto={ <img  src={imagem2} alt="CAMISETA 2"/>} valor={"45,00"} comprar={<button>comprar</button>}/>
            <Camisetas foto={ <img  src={imagem4} alt="CAMISETA 2"/>} valor={"45,00"} comprar={<button>comprar</button>}/>
            <Camisetas foto={ <img  src={imagem5} alt="CAMISETA 2"/>} valor={"45,00"} comprar={<button>comprar</button>}/> 
            <Camisetas foto={ <img  src={imagem6} alt="CAMISETA 2"/>} valor={"45,00"} comprar={<button>comprar</button>}/>        
        </div>
    )
}

export default HomePage
